import React, { useState, useEffect } from 'react';
import PoetryService from '../../../service/PoetryService';

import Modal from 'react-bootstrap/Modal'

import './PoetryDetail.css'

const PoetryDetail = (props) => {

    const poetryService = new PoetryService()

    const [poetryDetail, setPoetryDetail] = useState({});

    const id = (props.match.params.id)

    useEffect(() => {
      if (id) {
        poetryService
          .getOnePoetry(id)
          .then((response) => setPoetryDetail(response.data))
          .catch(err => console.log(err));
      }
      // eslint-disable-next-line
    }, [id])

    console.log(poetryDetail)
    const {title, body} = poetryDetail

    return (
      <Modal>
        <h1>{title}</h1>
        <h2>{body}</h2>
        <p className="property">~Dioni</p>
      </Modal>
    );
}

export default PoetryDetail;
